<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>ShapeViewer â€” Bangladesh</title>
<style>
@import url('https://fonts.googleapis.com/css2?family=Syne:wght@400;700;800&family=Fira+Code:wght@300;400;600&display=swap');

*,*::before,*::after{box-sizing:border-box;margin:0;padding:0}

:root{
  --ink:#0d1117;
  --paper:#f9f5ef;
  --accent:#1a6b3c;
  --accent2:#c1121f;
  --gold:#d4a017;
  --muted:#6b7280;
  --panel:#ffffff;
  --border:rgba(0,0,0,0.1);
  --shadow:0 2px 16px rgba(0,0,0,0.08);
}

body{
  background:var(--paper);
  color:var(--ink);
  font-family:'Fira Code',monospace;
  height:100vh;
  display:grid;
  grid-template-rows:56px 1fr;
  grid-template-columns:300px 1fr;
  overflow:hidden;
}

/* â”€â”€â”€ HEADER â”€â”€â”€ */
header{
  grid-column:1/-1;
  background:var(--ink);
  color:var(--paper);
  display:flex;
  align-items:center;
  padding:0 1.5rem;
  gap:1.5rem;
  border-bottom:3px solid var(--accent);
}
header h1{
  font-family:'Syne',sans-serif;
  font-weight:800;
  font-size:1.1rem;
  letter-spacing:-0.01em;
  white-space:nowrap;
}
header h1 span{color:var(--accent2);}
.header-sub{font-size:0.62rem;color:rgba(249,245,239,0.4);letter-spacing:0.1em;text-transform:uppercase;}
.header-right{margin-left:auto;display:flex;align-items:center;gap:1rem;}

.layer-chips{display:flex;gap:0.4rem;}
.chip{
  padding:0.25rem 0.7rem;
  border-radius:2px;
  font-size:0.6rem;
  letter-spacing:0.08em;
  text-transform:uppercase;
  cursor:pointer;
  border:1.5px solid transparent;
  font-family:'Fira Code',monospace;
  transition:all 0.15s;
  user-select:none;
}
.chip.active{background:var(--accent);color:#fff;border-color:var(--accent);}
.chip:not(.active){background:transparent;color:rgba(249,245,239,0.6);border-color:rgba(249,245,239,0.2);}
.chip:hover:not(.active){border-color:rgba(249,245,239,0.5);color:var(--paper);}

/* â”€â”€â”€ SIDEBAR â”€â”€â”€ */
aside{
  background:var(--panel);
  border-right:1px solid var(--border);
  display:flex;
  flex-direction:column;
  overflow:hidden;
}

.panel-section{
  padding:1rem;
  border-bottom:1px solid var(--border);
}
.panel-title{
  font-size:0.6rem;
  letter-spacing:0.12em;
  text-transform:uppercase;
  color:var(--muted);
  margin-bottom:0.6rem;
  font-family:'Syne',sans-serif;
}

/* Upload zone */
.upload-zone{
  border:2px dashed var(--border);
  border-radius:4px;
  padding:1.2rem;
  text-align:center;
  cursor:pointer;
  transition:all 0.2s;
  position:relative;
}
.upload-zone:hover,.upload-zone.dragover{
  border-color:var(--accent);
  background:rgba(26,107,60,0.04);
}
.upload-zone input{
  position:absolute;inset:0;opacity:0;cursor:pointer;width:100%;height:100%;
}
.upload-icon{font-size:1.5rem;margin-bottom:0.4rem;}
.upload-label{font-size:0.65rem;color:var(--muted);line-height:1.5;}
.upload-label strong{color:var(--accent);display:block;font-size:0.7rem;}

/* File list */
.file-list{
  flex:1;overflow-y:auto;
}
.file-item{
  display:flex;align-items:center;gap:0.6rem;
  padding:0.55rem 1rem;
  border-bottom:1px solid var(--border);
  cursor:pointer;
  transition:background 0.1s;
  position:relative;
}
.file-item:hover{background:rgba(0,0,0,0.025);}
.file-item.active{background:rgba(26,107,60,0.06);}
.file-dot{width:10px;height:10px;border-radius:50%;flex-shrink:0;}
.file-name{font-size:0.65rem;flex:1;overflow:hidden;text-overflow:ellipsis;white-space:nowrap;}
.file-badge{
  font-size:0.5rem;padding:0.15rem 0.4rem;
  background:var(--ink);color:var(--paper);
  border-radius:2px;letter-spacing:0.06em;flex-shrink:0;
}
.file-remove{
  background:none;border:none;cursor:pointer;color:var(--muted);
  font-size:0.8rem;padding:0 0.2rem;opacity:0;transition:opacity 0.15s;flex-shrink:0;
}
.file-item:hover .file-remove{opacity:1;}

/* Attributes panel */
.attr-panel{
  max-height:200px;overflow-y:auto;
}
.attr-row{
  display:grid;grid-template-columns:1fr 1.2fr;
  padding:0.3rem 1rem;border-bottom:1px solid rgba(0,0,0,0.04);font-size:0.6rem;
}
.attr-key{color:var(--muted);}
.attr-val{font-weight:600;overflow:hidden;text-overflow:ellipsis;white-space:nowrap;}
.attr-empty{padding:1rem;text-align:center;font-size:0.62rem;color:var(--muted);}

/* Legend */
.legend-items{display:flex;flex-direction:column;gap:0.25rem;max-height:180px;overflow-y:auto;}
.legend-item{display:flex;align-items:center;gap:0.5rem;font-size:0.62rem;}
.legend-swatch{width:14px;height:14px;border-radius:2px;flex-shrink:0;border:1px solid rgba(0,0,0,0.1);}

/* â”€â”€â”€ MAP AREA â”€â”€â”€ */
.map-wrap{
  position:relative;overflow:hidden;background:#e8f4f0;
}

/* Topographic texture */
.map-wrap::before{
  content:'';position:absolute;inset:0;
  background-image:
    radial-gradient(ellipse at 30% 60%, rgba(26,107,60,0.07) 0%, transparent 60%),
    radial-gradient(ellipse at 70% 30%, rgba(26,107,60,0.04) 0%, transparent 50%);
  pointer-events:none;z-index:0;
}

svg#map{width:100%;height:100%;cursor:grab;position:relative;z-index:1;}
svg#map:active{cursor:grabbing;}

/* Map controls */
.map-controls{
  position:absolute;bottom:1.5rem;right:1.5rem;
  display:flex;flex-direction:column;gap:0.3rem;z-index:10;
}
.map-btn{
  width:32px;height:32px;
  background:white;border:1px solid var(--border);
  box-shadow:var(--shadow);
  cursor:pointer;font-size:1rem;
  display:flex;align-items:center;justify-content:center;
  border-radius:2px;transition:all 0.15s;color:var(--ink);
}
.map-btn:hover{background:var(--accent);color:white;border-color:var(--accent);}

/* Scale bar */
.scale-bar{
  position:absolute;bottom:1.5rem;left:1rem;
  z-index:10;background:rgba(255,255,255,0.85);
  padding:0.3rem 0.5rem;border-radius:2px;border:1px solid var(--border);
  font-size:0.55rem;letter-spacing:0.06em;color:var(--muted);
}

/* Tooltip */
#tooltip{
  position:absolute;
  background:var(--ink);color:var(--paper);
  padding:0.5rem 0.75rem;
  font-size:0.62rem;line-height:1.6;
  pointer-events:none;opacity:0;
  transition:opacity 0.15s;z-index:20;
  max-width:200px;border-radius:2px;
  border-left:3px solid var(--accent);
}

/* Status bar */
.statusbar{
  position:absolute;top:0.5rem;left:50%;transform:translateX(-50%);
  background:rgba(255,255,255,0.9);border:1px solid var(--border);
  box-shadow:var(--shadow);padding:0.3rem 0.8rem;
  font-size:0.58rem;color:var(--muted);letter-spacing:0.06em;
  border-radius:2px;z-index:10;white-space:nowrap;
  display:flex;gap:1rem;
}
.statusbar span{color:var(--ink);font-weight:600;}

/* Scrollbar */
::-webkit-scrollbar{width:4px;}
::-webkit-scrollbar-track{background:transparent;}
::-webkit-scrollbar-thumb{background:rgba(0,0,0,0.15);border-radius:2px;}

/* Error toast */
.toast{
  position:fixed;bottom:1rem;right:1rem;
  background:#c1121f;color:white;
  padding:0.6rem 1rem;font-size:0.65rem;
  border-radius:2px;z-index:100;
  opacity:0;transition:opacity 0.3s;pointer-events:none;
}
.toast.show{opacity:1;}

@keyframes fadeUp{from{opacity:0;transform:translateY(4px)}to{opacity:1;transform:none}}
.file-item{animation:fadeUp 0.2s ease;}
</style>
</head>

// â”€â”€â”€ SVG SETUP â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
const svg = d3.select('#map');
const mapWrap = document.getElementById('mapWrap');
let width, height;

function resize() {
  width = mapWrap.clientWidth;
  height = mapWrap.clientHeight;
  svg.attr('viewBox', `0 0 ${width} ${height}`);
}
resize();
window.addEventListener('resize', () => { resize(); fitAll(); });

const g = svg.append('g').attr('id','rootG');

// Graticule
const graticuleG = g.append('g').attr('id','graticule');
const featureG = g.append('g').attr('id','features');

const projection = d3.geoMercator();
const pathGen = d3.geoPath().projection(projection);

// Zoom
const zoom = d3.zoom()
  .scaleExtent([0.3, 800])
  .on('zoom', (event) => {
    g.attr('transform', event.transform);
    const k = event.transform.k;
    // Scale stroke widths
    featureG.selectAll('.geo-path')
      .attr('stroke-width', d => (d._strokeBase || 1) / k);
    document.getElementById('statZoom').textContent = k.toFixed(2) + 'Ã—';
  });

svg.call(zoom);

// Mouse coordinate display
svg.on('mousemove', function(event) {
  const [mx, my] = d3.pointer(event, g.node());
  const transform = d3.zoomTransform(svg.node());
  const [lx, ly] = transform.invert([mx * transform.k + transform.x, my * transform.k + transform.y]);
  // Actually use projection.invert
  try {
    const lonlat = projection.invert(d3.pointer(event, featureG.node()));
    if (lonlat) {
      document.getElementById('coordDisplay').textContent =
        `${lonlat[1].toFixed(4)}Â°N  ${lonlat[0].toFixed(4)}Â°E`;
    }
  } catch(e){}
});

// â”€â”€â”€ SHAPEFILE PARSER â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function parseDBF(buffer) {
  const view = new DataView(buffer);
  const numRecords = view.getInt32(4, true);
  const headerSize = view.getInt16(8, true);
  const recordSize = view.getInt16(10, true);

  const fields = [];
  let offset = 32;
  while (offset < headerSize - 1) {
    const terminator = view.getUint8(offset);
    if (terminator === 0x0D) break;
    let name = '';
    for (let i = 0; i < 11; i++) {
      const c = view.getUint8(offset + i);
      if (c !== 0) name += String.fromCharCode(c);
    }
    const fieldType = String.fromCharCode(view.getUint8(offset + 11));
    const length = view.getUint8(offset + 16);
    fields.push({ name: name.trim(), type: fieldType, length });
    offset += 32;
  }

  const records = [];
  const decoder = new TextDecoder('utf-8', { fatal: false });
  let recOffset = headerSize;
  for (let r = 0; r < numRecords; r++) {
    const flag = view.getUint8(recOffset);
    recOffset++;
    const rec = {};
    for (const field of fields) {
      const bytes = new Uint8Array(buffer, recOffset, field.length);
      rec[field.name] = decoder.decode(bytes).trim();
      recOffset += field.length;
    }
    if (flag !== 0x2A) records.push(rec);
  }
  return records;
}

function parseSHP(buffer, records) {
  const view = new DataView(buffer);
  const features = [];
  let offset = 100;

  function readDouble(pos) { return view.getFloat64(pos, true); }

  let recIdx = 0;
  while (offset < buffer.byteLength - 8) {
    const contentLen = view.getInt32(offset + 4, false) * 2;
    if (contentLen <= 0 || offset + 8 + contentLen > buffer.byteLength) break;
    const shapeType = view.getInt32(offset + 8, true);
    const props = (records && recIdx < records.length) ? records[recIdx] : {};
    recIdx++;

    if (shapeType === 0) {
      offset += 8 + contentLen;
      continue;
    }

    // Polygon (type 5) or PolyLine (type 3)
    if (shapeType === 5 || shapeType === 3) {
      const numParts = view.getInt32(offset + 8 + 36, true);
      const numPoints = view.getInt32(offset + 8 + 40, true);
      const partsStart = offset + 8 + 44;
      const ptsStart = partsStart + numParts * 4;

      const parts = [];
      for (let p = 0; p < numParts; p++) {
        parts.push(view.getInt32(partsStart + p * 4, true));
      }

      const allPts = [];
      for (let pt = 0; pt < numPoints; pt++) {
        const x = readDouble(ptsStart + pt * 16);
        const y = readDouble(ptsStart + pt * 16 + 8);
        allPts.push([Math.round(x * 10000) / 10000, Math.round(y * 10000) / 10000]);
      }

      const rings = [];
      for (let p = 0; p < numParts; p++) {
        const start = parts[p];
        const end = p + 1 < numParts ? parts[p + 1] : numPoints;
        rings.push(allPts.slice(start, end));
      }

      let geom;
      if (shapeType === 3) {
        geom = numParts === 1
          ? { type: 'LineString', coordinates: rings[0] }
          : { type: 'MultiLineString', coordinates: rings };
      } else {
        geom = { type: 'MultiPolygon', coordinates: rings.map(r => [r]) };
      }
      features.push({ type: 'Feature', properties: props, geometry: geom });
    }

    offset += 8 + contentLen;
  }
  return { type: 'FeatureCollection', features };
}

// â”€â”€â”€ LAYER MANAGEMENT â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function addLayer(name, geojson, color, layerType) {
  const id = 'layer_' + Date.now() + '_' + Math.random().toString(36).slice(2);
  const layer = { id, name, geojson, color, visible: true, type: layerType || 'user' };
  state.layers.push(layer);
  renderLayer(layer);
  updateSidebar();
  fitAll();
  return layer;
}

function renderLayer(layer) {
  if (!layer.geojson) return;

  const g2 = featureG.append('g')
    .attr('id', layer.id)
    .attr('class', 'layer-group');

  const k = d3.zoomTransform(svg.node()).k;

  g2.selectAll('path')
    .data(layer.geojson.features.filter(f => f.geometry))
    .join('path')
    .attr('class', 'geo-path')
    .attr('d', pathGen)
    .attr('fill', f => {
      // Use division colors for ADM1
      if (layer.type === 'adm1' && f.properties && f.properties.ADM1_EN) {
        return DIV_COLORS[f.properties.ADM1_EN] || layer.color;
      }
      return layer.type === 'adm0' ? 'none' : layer.color + '55';
    })
    .attr('stroke', layer.type === 'adm0' ? '#1a6b3c' : layer.color)
    .attr('stroke-width', layer.type === 'adm0' ? 2/k : 1/k)
    .attr('stroke-linejoin', 'round')
    .each(function(d) {
      d._strokeBase = layer.type === 'adm0' ? 2 : 1;
    })
    .on('mouseover', function(event, d) {
      d3.select(this).raise().attr('stroke-width', (d._strokeBase || 1) / k * 2.5);
      showTooltip(event, d, layer);
      showAttrs(d.properties);
    })
    .on('mousemove', function(event, d) {
      moveTooltip(event);
    })
    .on('mouseout', function(event, d) {
      const curK = d3.zoomTransform(svg.node()).k;
      d3.select(this).attr('stroke-width', (d._strokeBase || 1) / curK);
      hideTooltip();
    });
}

function removeLayer(id) {
  state.layers = state.layers.filter(l => l.id !== id);
  featureG.select('#' + id).remove();
  updateSidebar();
  if (state.layers.length > 0) fitAll();
}

function toggleLayerVisible(id) {
  const layer = state.layers.find(l => l.id === id);
  if (!layer) return;
  layer.visible = !layer.visible;
  featureG.select('#' + id).attr('display', layer.visible ? null : 'none');
  updateSidebar();
}

// â”€â”€â”€ LAYER VISIBILITY BY TYPE â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
let currentLayerFilter = 'all';
function setLayer(type) {
  currentLayerFilter = type;
  document.querySelectorAll('.chip').forEach(c => {
    c.classList.toggle('active', c.dataset.layer === type);
  });
  state.layers.forEach(layer => {
    const show = type === 'all' ||
      (type === 'adm0' && layer.type === 'adm0') ||
      (type === 'adm1' && layer.type === 'adm1') ||
      (type === 'all');
    const shouldShow = type === 'all' || layer.type === type || layer.type === 'user';
    featureG.select('#' + layer.id).attr('display', shouldShow && layer.visible ? null : 'none');
  });
}

// â”€â”€â”€ FIT VIEW â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function getAllFeatures() {
  return state.layers
    .filter(l => l.visible)
    .flatMap(l => l.geojson.features.filter(f => f.geometry));
}

function fitAll() {
  const feats = getAllFeatures();
  if (feats.length === 0) return;
  const collection = { type: 'FeatureCollection', features: feats };
  projection.fitSize([width - 80, height - 80], collection);
  pathGen.projection(projection);
  // Re-render all paths
  featureG.selectAll('.geo-path').attr('d', pathGen);
  // Re-render graticule
  drawGraticule();
  svg.transition().duration(400).call(zoom.transform, d3.zoomIdentity);
}

function zoomBy(factor) {
  svg.transition().duration(250).call(zoom.scaleBy, factor);
}

// â”€â”€â”€ GRATICULE â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function drawGraticule() {
  const grat = d3.geoGraticule().step([2, 2]);
  graticuleG.selectAll('*').remove();
  graticuleG.append('path')
    .datum(grat())
    .attr('d', pathGen)
    .attr('fill', 'none')
    .attr('stroke', 'rgba(0,0,0,0.07)')
    .attr('stroke-width', 0.5);
}

// â”€â”€â”€ TOOLTIP â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
const tooltipEl = document.getElementById('tooltip');
function showTooltip(event, d, layer) {
  const props = d.properties || {};
  const name = props.ADM1_EN || props.ADM0_EN || props.NAME || props.name || layer.name;
  let html = `<strong style="font-family:'Syne',sans-serif;">${name}</strong>`;
  const pcode = props.ADM1_PCODE || props.ADM0_PCODE;
  if (pcode) html += `<br/><span style="opacity:0.6">${pcode}</span>`;
  tooltipEl.innerHTML = html;
  tooltipEl.style.opacity = '1';
  moveTooltip(event);
}
function moveTooltip(event) {
  const rect = mapWrap.getBoundingClientRect();
  let x = event.clientX - rect.left + 12;
  let y = event.clientY - rect.top - 10;
  if (x + 200 > width) x -= 220;
  tooltipEl.style.left = x + 'px';
  tooltipEl.style.top = y + 'px';
}
function hideTooltip() { tooltipEl.style.opacity = '0'; }

// â”€â”€â”€ ATTRIBUTES â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function showAttrs(props) {
  const panel = document.getElementById('attrPanel');
  if (!props || Object.keys(props).length === 0) {
    panel.innerHTML = '<div class="attr-empty">No properties</div>';
    return;
  }
  panel.innerHTML = Object.entries(props)
    .filter(([k, v]) => v)
    .map(([k, v]) => `
      <div class="attr-row">
        <div class="attr-key">${k}</div>
        <div class="attr-val" title="${v}">${v}</div>
      </div>`)
    .join('');
}

// â”€â”€â”€ SIDEBAR â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function updateSidebar() {
  const list = document.getElementById('fileList');
  const legend = document.getElementById('legend');
  document.getElementById('layerCount').textContent = `(${state.layers.length})`;
  document.getElementById('statLayers').textContent = state.layers.length;
  document.getElementById('statFeats').textContent = state.layers.reduce((a, l) => a + (l.geojson?.features?.length || 0), 0);

  list.innerHTML = state.layers.map(layer => `
    <div class="file-item ${!layer.visible ? 'muted' : ''}" onclick="toggleLayerVisible('${layer.id}')">
      <div class="file-dot" style="background:${layer.color};${!layer.visible ? 'opacity:0.3' : ''}"></div>
      <div class="file-name">${layer.name}</div>
      <div class="file-badge">${layer.geojson?.features?.length || 0}</div>
      <button class="file-remove" onclick="event.stopPropagation();removeLayer('${layer.id}')" title="Remove">âœ•</button>
    </div>`).join('');

  // Legend - show ADM1 divisions if present
  const adm1Layer = state.layers.find(l => l.type === 'adm1');
  if (adm1Layer) {
    const items = adm1Layer.geojson.features
      .filter(f => f.properties?.ADM1_EN)
      .map(f => {
        const name = f.properties.ADM1_EN;
        const col = DIV_COLORS[name] || adm1Layer.color;
        return `<div class="legend-item">
          <div class="legend-swatch" style="background:${col}"></div>
          <span>${name}</span>
        </div>`;
      });
    legend.innerHTML = items.join('');
  } else {
    legend.innerHTML = state.layers.map(l =>
      `<div class="legend-item">
        <div class="legend-swatch" style="background:${l.color}"></div>
        <span>${l.name}</span>
      </div>`).join('');
  }
}

// â”€â”€â”€ FILE HANDLING â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
const fileGroups = {}; // basename -> {shp, dbf, ...}

function groupFiles(files) {
  for (const file of files) {
    const ext = file.name.split('.').pop().toLowerCase();
    const base = file.name.slice(0, file.name.lastIndexOf('.'));
    if (!fileGroups[base]) fileGroups[base] = {};
    fileGroups[base][ext] = file;
  }
  processGroups();
}

async function processGroups() {
  for (const [base, group] of Object.entries(fileGroups)) {
    if (!group.shp) continue;
    if (group._loaded) continue;
    group._loaded = true;

    try {
      const shpBuf = await group.shp.arrayBuffer();
      let records = null;
      if (group.dbf) {
        const dbfBuf = await group.dbf.arrayBuffer();
        records = parseDBF(dbfBuf);
      }
      const geojson = parseSHP(shpBuf, records);
      const color = PALETTE[colorIdx % PALETTE.length];
      colorIdx++;

      // Detect layer type
      let layerType = 'user';
      const lowerBase = base.toLowerCase();
      if (lowerBase.includes('adm0')) layerType = 'adm0';
      else if (lowerBase.includes('adm1')) layerType = 'adm1';

      addLayer(base, geojson, color, layerType);
      showToast(`Loaded: ${base} (${geojson.features.length} features)`, false);
    } catch (e) {
      showToast(`Error loading ${base}: ${e.message}`);
    }
  }
}

// â”€â”€â”€ DRAG & DROP â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
const dropZone = document.getElementById('dropZone');
const fileInput = document.getElementById('fileInput');

fileInput.addEventListener('change', e => groupFiles([...e.target.files]));

dropZone.addEventListener('dragover', e => { e.preventDefault(); dropZone.classList.add('dragover'); });
dropZone.addEventListener('dragleave', () => dropZone.classList.remove('dragover'));
dropZone.addEventListener('drop', e => {
  e.preventDefault();
  dropZone.classList.remove('dragover');
  groupFiles([...e.dataTransfer.files]);
});

// Also allow dropping anywhere on the map
document.getElementById('mapWrap').addEventListener('dragover', e => e.preventDefault());
document.getElementById('mapWrap').addEventListener('drop', e => {
  e.preventDefault();
  groupFiles([...e.dataTransfer.files]);
});

// â”€â”€â”€ TOAST â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function showToast(msg, isError = true) {
  const t = document.getElementById('toast');
  t.textContent = msg;
  t.style.background = isError ? '#c1121f' : '#1a6b3c';
  t.classList.add('show');
  setTimeout(() => t.classList.remove('show'), 3000);
}
